!function(){"use strict";window.addEventListener("letsee.load",()=>{let e=document.createElement("div");e.style.position="absolute";e.style.top=0;e.style.width=window.screen.availWidth+"px";e.style.height=-50+window.screen.availHeight+"px";e.style.overflow="hidden";e.innerHTML=`\n        <style>\n            .letsee-main-wrapper{\n                overflow: hidden;\n            }\n\n            .letsee-main-wrapper text{\n                color:#fff;\n                font-size: 2px;\n                font-weight: 600;\n                font-family: SFUIDisplay, sans-serif;\n                text-shadow:0 0 20px #00b3c4;\n                fill:#fff;\n                animation:2.5s letsee-main-text infinite;\n                opacity:0;\n            }\n\n            .circle{\n                opacity:0;\n                transform-origin:50% 50%;\n                fill:rgba(0, 234, 255, 0.1);\n                stroke:rgba(0, 234, 255, 0.1);\n                stroke-width:.01; \n            }\n\n            .circle.a{ cx:20; cy:20; r: 2.2; animation:4s letsee-main infinite;}\n            .circle.b{ cx:20; cy:20; r: 1.8; animation:4s letsee-main infinite;}\n            .circle.c{ cx:20; cy:20; r: 1.3; animation:3.7s letsee-main infinite;}\n\n            @keyframes letsee-main{\n                60%{\n                    opacity:0.8;\n                }\n                100% {\n                    opacity:0;\n                    transform:scale(20);\n                }\n                \n                }\n\n                @keyframes letsee-main-text{\n                60%{\n                    opacity:0.5;\n                }\n                100% {\n                    opacity:0;\n                }\n                \n            }            \n        </style>\n        <div class="letsee-main-wrapper">\n            \n            \x3c!-- viewBox : mx,my,w,h --\x3e\n            <svg viewBox="0 0 40 40"\n                xmlns="http://www.w3.org/2000/svg">\n            \n            <text text-anchor="middle"\n                    x="20"\n                    y="20">Letsee..</text>\n            \n            <g> <circle class="circle a"></circle> </g>\n            <g> <circle class="circle b"></circle> </g>\n            <g> <circle class="circle c"></circle> </g>\n            </svg>\n            \n        </div>\n    `;window.document.body.appendChild(e);let t=document.querySelector(".letsee-main-wrapper svg");t.style.width=window.screen.availWidth+"px";t.style.height=window.screen.availHeight+"px";letsee.addEventListener("trackstart",e=>t.style.display="none");letsee.addEventListener("trackend",e=>t.style.display="block")})}();